function Product(props){
  const obj = props.obj;
  function handleChangePage(){
    props.changePage("product")
  }

  return (<a href={`/product:${props.id}`}className="Product" onClick={handleChangePage}>
    <img src={obj.img}/>
    <label className="name">{obj.name}</label>
    <label className="price">{obj.price}</label>
  </a>)
}

export default Product;
